result:
.userBox{
    background: #F0F1F2;
}
.bgt{
    border-bottom: 1px solid #F0F2F7;
}
.user{
    &-header{
        width: 100%;
        height: 1.5rem;
        line-height: 1.5rem;
        &-img{
            width: 1.1rem;
            height: 1.1rem;
            border-radius: 50%;
            overflow: hidden;
            img{
                width: 100%;
                height: 100%;
            }
        }
        &-name{
            .sp1{
                color: #282828;
                font-size: 0.32rem;
                font-weight: bold;
            }
            .sp2{
                background: rgba(56, 117, 234, 0.14);
                color: #3875EA;
                font-size: 0.18rem;
                padding: 0.1rem;
                border-radius: 4px;
            }
        }
        padding: 0 0.3rem;
        background: #fff;
        margin-bottom: 0.15rem;
    }
    &-list{
        padding: 0 0.2rem;
        background: #fff;
        margin-bottom: 0.15rem;
        .item{
            width: 100%;
            padding: .2rem 0;
            .sp1{
                color: #686868;
                font-size: 0.28rem;
                width: 1.6rem;
            }
            .sp2{
                color: #282828;
                font-size: 0.28rem;
            }
        }
        .labelBox{
            display: flex;
            flex-wrap: wrap;
            width: 4.8rem;
        }
        .label{
            display: flex;
            align-items: center;
            justify-content: center;
            height: .5rem;
            border: 1px solid #3875EA;
            opacity: 1;
            border-radius: 16px;
            padding: 0 0.15rem;
            text-align: center;
            color: #3875EA;
            font-size: 0.2rem;
            margin: .07rem .15rem .07rem 0;
        }
    }
}
